import "./Line.css";
import "./Lab1EmptyList.css";

function Line(props) {
    function emptyCheck(props) {
        return (
            props.field !== ""
        );
    }

    function lineLogic(props) {
        if (props.clicked) {
            return (<li>
                <input className={"checkboxes"}
                       type={"checkbox"}>
                </input>
                <input className={"textboxes"}
                       type={"text"}
                       onClick={(e) => {
                           e.stopPropagation()
                       }}

                       onChange={
                           (e) => props.onLineChangeField(props.line.key, e.target.value)
                       }
                       value={props.line.field}>
                </input>
            </li>)
        } else if (emptyCheck(props)) {
            return (<li>
                <input className={"checkboxes"}
                       type={"checkbox"}
                       onChange={(e) => {props.onCheck(props.line.key)}}>
                </input>
                <input className={"textboxes"}
                       type={"text"}
                       onClick={(e) => {
                           {props.onClickLine(props.line.key)}
                           e.stopPropagation();

                       }}

                       onChange={
                           (e) => props.onLineChangeField(props.line.key, e.target.value)
                       }
                       value={props.line.field}>
                </input>
            </li>);

        } else {
            return (<li>
                <input className={"emptyCheckbox"}
                       type={"checkbox"}>
                </input>
                <input className={"textboxes"}
                       disabled={true}
                       type={"text"}
                       value={props.field}>
                </input>
            </li>);
        }
    }

return (
    <div className={"all-lines"} onClick={(e) => {props.onClickLine(-1)}}>
        {lineLogic(props)}
        {console.log(props.line.checked)}
    </div>
)
}

export default Line;
